    //validaciones cod sis
    if (!Codigo_Sis.trim()) {
      setFalloCS(true);
      setErrorCS("Debe ingrsar un Codigo Sis");
    } else {
      if (Codigo_Sis.match(/[^0-9]/)) {
        setFalloCS(true);
        setErrorCS("*Solo acepta numeros ");
      } else {
        {
          setFalloCS(false);
          setErrorCS("");
        }
